import React, { useState } from 'react';
import { Link, useHistory } from 'react-router-dom';
import { useCreateUserWithEmailAndPassword } from 'react-firebase-hooks/auth';
import tomate from '../images/tomate.png';
import logo from '../images/logo.svg';
import '../index.css';
import { auth } from '../services/firebaseConfig';

function Register() {
  const history = useHistory();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [
    createUserWithEmailAndPassword,
    user,
    loading,
    error,
  ] = useCreateUserWithEmailAndPassword(auth);

  const handleRegister = (e) => {
    e.preventDefault();
    createUserWithEmailAndPassword(email, password);
  };

  if (error) {
    return (
      <main className="flex flex-col items-center h-screen bg-img">

        <div className="flex flex-col items-center z-[1]">
          <div className="mt-14">
            <img src={ logo } alt="logo" className="w-[200px] md:w-[250px]" />
          </div>

          <div className="md:flex md:flex-start md:w-screen">
            <div className="my-1">
              <img src={ tomate } alt="logo" className="w-[458px] md:w-[600px]" />
            </div>
          </div>
        </div>

        <div className="login-container">
          <div>
            <p>
              Erro:
              {error.message}
            </p>
            <Link to="/register" />
          </div>
        </div>
      </main>
    );
  }
  if (loading) {
    return (
      <main className="flex flex-col items-center h-screen bg-img">

        <div className="flex flex-col items-center z-[1]">
          <div className="mt-14">
            <img src={ logo } alt="logo" className="w-[200px] md:w-[250px]" />
          </div>

          <div className="md:flex md:flex-start md:w-screen">
            <div className="my-1">
              <img src={ tomate } alt="logo" className="w-[458px] md:w-[600px]" />
            </div>
          </div>
        </div>

        <div className="login-container">
          <p>Loading...</p>
        </div>
      </main>
    );
  }
  if (user) {
    return (
      <main className="flex flex-col items-center h-screen bg-img">

        <div className="flex flex-col items-center z-[1]">
          <div className="mt-14">
            <img src={ logo } alt="logo" className="w-[200px] md:w-[250px]" />
          </div>

          <div className="md:flex md:flex-start md:w-screen">
            <div className="my-1">
              <img src={ tomate } alt="logo" className="w-[458px] md:w-[600px]" />
            </div>
          </div>
        </div>

        <div className="login-container">
          <p>
            Usuário registrado com sucesso!:
            {user.user.email}
          </p>
        </div>
      </main>
    );
  }

  return (
    <main className="flex flex-col items-center h-screen bg-img">

      <div className="flex flex-col items-center z-[1]">
        <div className="mt-14">
          <img src={ logo } alt="logo" className="w-[200px] md:w-[250px]" />
        </div>

        <div className="md:flex md:flex-start md:w-screen">
          <div className="my-1">
            <img src={ tomate } alt="logo" className="w-[458px] md:w-[600px]" />
          </div>
        </div>
      </div>

      <div className="login-container">

        <h1 className="title-login">
          Create your account
        </h1>

        <form className="flex flex-col">
          <input
            type="email"
            placeholder="Digite seu Email"
            className="input-login"
            onChange={ (e) => setEmail(e.target.value) }
          />

          <input
            type="password"
            placeholder="Digite uma Senha"
            className="input-login my-2"
            onChange={ (e) => setPassword(e.target.value) }
          />

          <button
            type="submit"
            className="button-login bg-yellow"
            onClick={ handleRegister }
          >
            Cadastrar
          </button>
          <p>Você já tem uma conta?</p>
          <Link to="/">Acesse sua conta aqui</Link>
        </form>
      </div>
    </main>

  );
}

export default Register;
